import React from 'react'
import styled from "styled-components";

const Container = styled.div`
    background-color:var(--p-5);
    height:300px;
    width:300px;
    position:relative;
    font-size:100px;
`

const Box1 = styled.div`
    background-color:var(--s-5);
    height:1em;
    width:1em;
    position:absolute;
    opacity:50%;
`

const Box2 = styled.div`
    background-color:var(--s-3);
    height:1em;
    width:1em;
    position:absolute;
    transform:translateY(-.93em) translateX(-.24em) skew(30deg) rotateX(30deg);
    opacity:50%;
`
const Box3 = styled.div`
    background-color:var(--s-3);
    height:1em;
    width:1em;
    position:absolute;
    transform:translateY(-1.61em) translateX(-.92em) skew(60deg) rotateX(60deg);
    opacity:50%;
`
const Box4 = styled.div`
    background-color:var(--s-3);
    height:1em;
    width:1em;
    position:absolute;
    transform:translateY(.93em) translateX(-.24em) skew(-30deg) rotateX(-30deg);
    opacity:50%;
`
const Box5 = styled.div`
    background-color:var(--s-3);
    height:1em;
    width:1em;
    position:absolute;
    transform:translateY(1.61em) translateX(-.92em) skew(-60deg) rotateX(-60deg);
    opacity:50%;
`

const Row = styled.div`
    top:50%;
    left:50%;
    position:absolute;
`
const Row2 = styled.div`
    top:50%;
    left:50%;
    position:absolute;
    transform:rotateZ(-60deg) translateY(-1em) translateX(1em);
`

export default function Figure() {
    return (
        <Container>
            <Row>
                <Box1/>
                <Box2/>
                <Box3/>
                <Box4/>
                <Box5/>
            </Row>
            <Row2>
                <Box1/>
                <Box2/>
                <Box3/>
                <Box4/>
                <Box5/>
            </Row2>
            <Row3>
                <Box1/>
                <Box2/>
                <Box3/>
                <Box4/>
                <Box5/>
            </Row3>
        </Container>
    )
}
